import "./TimeLine.css";
import React from "react";

function JobItem() {
  return (
    <div className="job_item_container">
      <h1 className="jobtitle">Job Title</h1>
      <h1 className="joblocation">@Job location</h1>
      <h1 className="jobextra">Job extra</h1>
    </div>
  );
}

export default JobItem;
